    return (
        <div>
            <TextField label="Search a City" variant="outlined" fullWidth />
            <Button variant="contained" color="secondary">Search</Button>
            <Radio
                onChange={() => console.log('hello')}
                value="e"
                size="small"
                label="Near Me"
                labelPlacement="end"
            />
        </div>
    );
}
